  return (
    <NavUl>
      <NavLi>
        <Link href="/">
          <a>홈</a>
        </Link>
      </NavLi>
      <NavLi>
        <Link href="/drawing">
          <a>그림그리기</a>
        </Link>
      </NavLi>
      <NavLi>
        <Link href="/upload">
          <a>업로드</a>
        </Link>
      </NavLi>
      <NavLi>
        <Link href="/gallery">
          <a>갤러리</a>
        </Link>
      </NavLi>
      <NavLi>
        {isLoggedIn ? (
          <>
            <Link href="/mypage">
              <a>마이페이지</a>
            </Link>
            <Text> / </Text>
            <button
              style={{
                border: 'none',
                background: 'transparent',
                color: 'black',
                fontSize: '16px',
                fontWeight: 'bold',
                color: '#333333',
              }}
            >
              로그아웃
            </button>
          </>
        ) : (
          <>
            <Link href="/login">
              <a>로그인</a>
            </Link>
            <Text> / </Text>
            <Link href="/signUp">
              <a>회원가입</a>
            </Link>
          </>
        )}
      </NavLi>
    </NavUl>
  );
};

export default Navigation;
